export default class HttpRespondable {
    static OK(payload?: any): any;
    static CREATED(payload?: any): any;
    static NO_CONTENT(): any;
    static BAD_REQUEST(payload?: any): any;
    static UNAUTHORIZED(payload?: any): any;
    static FORBIDDEN(payload?: any): any;
    static NOT_FOUND(payload?: any): any;
    static CONFLICT(payload?: any): any;
    static INTERNAL_SERVER_ERROR(payload?: any): any;
}
